contracts/TankToys/Tank_Players.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract TankToys_Players {
    
    struct user {
        address[] friends;
        // address direction;
        partida ultima;
    }

    struct partida {
        address[] players;
        address[] winners;
        bool win;
        uint kills;
        uint deaths;
        uint assist;
    }

    mapping  (address => user) usuarios;

    function getLastMathch(address player) public view returns (partida memory p) {
        return usuarios[player].ultima;
    }

    function getFriends(address player) public view returns (address[] memory friends) {
        return  usuarios[player].friends;
    }

    function addFriend(address player, address newfriend) public  {
        usuarios[player].friends.push(newfriend);
    }

    function addPlayer(address player) public  {
        address[] memory players;
        usuarios[player] = user(players ,partida(players,players,false,0,0,0));
    }

    function updateLastMatch(address player, address[] memory players, address[] memory winners, bool win, uint kills, uint deaths, uint assist) public  {
        usuarios[player].ultima = partida(players,winners,win,kills,deaths,assist);
    }

}

